e, to find out if Carole could be involved in his disappearance.\\n\\nNow, in the comments, what do you think happened to Don Lewis? Was it the tigers, septic tank, did she hide him during that suspicious 3AM drive, or maybe you somehow believe that he crashed his little airplane in the ocean.  Let everyone know in the comments below.\\n\\nGive this video a thumbs up if you think Carole Baskin was somehow involved in Don Lewis’s disappearance.\\nGive this video a thumbs down if you think Carole Baskin wasn’t involved at all.\\n\\nHit that subscribe button now, so you don’t miss out on new body language and investigative videos that always shake up YouTube, and I’ll see you at the top.\\n\\n#TigerKing #CaroleBaskin #BodyLanguage\\n\\nMore Channel:\\r\\nhttps:\/\/www.youtube.com\/channel\/UCGof-YmYH1e-Hu9tmH39_rw\\r\\n\\r\\nSHAKED Podcast:\\r\\nhttps:\/\/www.youtube.com\/shaked\\r\\n\\r\\nFollow me and also send me your future video ideas via social media:\\r\\nInstagram:\\r\\nhttps:\/\/www.instagram.com\/derekvanschaik\\r\\n\\r\\nTwitter:\\r\\nhttps:\/\/www.twitter.com\/derekvanschaik\\r\\n\\r\\nFacebook:\\r\\nhttps:\/\/www.facebook.com\/derekvanschaik\\r\\n\\r\\nWebsite:\\r\\nhttps:\/\/www.derekvanschaik.com\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/TfWGDeV8ZjE\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLCS-W5Q94hdGDTCuwY-jxTOfWJTkQ\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/TfWGDeV8ZjE\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLDbCS0h2YD3l1LDb2W30bqKjnCdGA\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/TfWGDeV8ZjE\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLCOzS26yo_g3zluljm4EdzAisSqdg\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/TfWGDeV8ZjE\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADI She runs a private exotic cat zoo called Big Cat Rescue and throughout the docu-series she claims to be morally superior to Joe Exotic, but personally I didn’t see her zoo that much better to the big cats than Joe Exotic’s zoo; those big cats were still all locked up in small cages.\n\nIn 1997, when Carole’s second husband and multi-millionaire, Don Lewis, was getting ready to file for divorce while also taking other legal precautions to keep himself safe from Carole. One night, Don magically vanishes off the face of the Earth. So, we’re going to piece together all the evidence, along with breaking down her body language, to find out if Carole could be involved in his disappearance.\n\nNow, in the comments, what do you think happened to Don Lewis? Was it the tigers, septic tank, did she hide him during that suspicious 3AM drive, or maybe you somehow believe that he crashed his little airplane in the ocean.  Let everyone know in the comments below.\n\nGive this video a thumbs up if you think Carole Baskin was somehow involved in Don Lewis’s disappearance.\nGive this video a thumbs down if you think Carole Baskin wasn’t involved at all.\n\nHit that subscribe button now, so you don’t miss out on new body language and investigative videos that always shake up YouTube, and I’ll see you at the top.\n\n"},{"text":"#TigerKing","navigationEndpoint":{"clickTrackingParams":"CJcBENzXBCITCOPz08TJmOoCFYjfFgod6s4LuA==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23TigerKing","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{"query":"#TigerKing"}},"loggingDirectives":{"trackingParams":"CJcBENzXBCITCOPz08TJmOoCFYjfFgod6s4LuA==","visibility":{"types":"12"}}},{"text":" "},{"text":"#CaroleBaskin","navigationEndpoint":{"clickTrackingParams":"CJYBENzXBCITCOPz08TJmOoCFYjfFgod6s4LuA==","commandMetadata":{"webCommandMetadata":{"url":"/results?search_query=%23CaroleBaskin","webPageType":"WEB_PAGE_TYPE_SEARCH","rootVe":4724}},"searchEndpoint":{" acter in the show is Joe Exotic, known as the Tiger King, and ran the GW Zoo in Oklahoma, USA. His cross-country nemesis was Carole Baskin, who I’m calling the Tiger Queen. She runs a private exotic cat zoo called Big Cat Rescue and throughout the docu-series she claims to be morally superior to Joe Exotic, but personally I didn’t see her zoo that much better to the big cats than Joe Exotic’s zoo; those big cats were still all locked up in small cages.\n\nIn 1997, when Carole’s second husband and multi-millionaire, Don Lewis, was getting ready to file for divorce while also taking other legal precautions to keep himself safe from Carole. One night, Don magically vanishes off the face of the Earth. So, we’re going to piece together all the evidence, along with breaking down her body language, to find out if Carole could be involved in his disappearance.\n\nNow, in the comments, what do you think happened to Don Lewis? Was it the tigers, septic tank, did she hide him during that suspicious 3AM drive, or maybe you somehow believe that he crashed his little airplane in the ocean.  Let everyone know in the comments below.\n\nGive this video a thumbs up if you think Carole Baskin was somehow involved in Don Lewis’s disappearance.\nGive this video a thumbs down if you think Carole Baskin wasn’t involved at all.\n\nHit that subscribe button now, so you don’t miss out on new body language and investigative videos that always shake up YouTube, and I’ll see you at the top.\n\n#TigerKing #CaroleBaskin #BodyLanguage\n\nMore Channel:\r\nhttps://www.youtube.com/channel/UCGof-YmYH1e-Hu9tmH39_rw\r\n\r\nSHAKED Podcast:\r\nhttps://www.youtube.com/shaked\r\n\r\nFollow me and also send me your future video ideas via social media:\r\nInstagram:\r\nhttps://www.instagram.com/derekvanschaik\r\n\r\nTwitter:\r\nhttps://www.twitter.com/derekvanschaik\r\n\r\nFacebook:\r\nhttps://www.facebook.com/derekvanschaik\r\n\r\nWebsite:\r\nhttps://www.derekvanschaik.com","isCrawlable":true,"thumbnail":{"t  revealed the secrets of the exotic cat trade in the United States.  Each episode just gets crazier and crazier. The people involved are wacky and not just because they jump into cages with lions, tigers, and ligers, but their lives are crazy in every way imaginable crazy. The main character in the show is Joe Exotic, known as the Tiger King, and ran the GW Zoo in Oklahoma, USA. His cross-country nemesis was Carole Baskin, who I’m calling the Tiger Queen. She runs a private exotic cat zoo called Big Cat Rescue and throughout the docu-series she claims to be morally superior to Joe Exotic, but personally I didn’t see her zoo that much better to the big cats than Joe Exotic’s zoo; those big cats were still all locked up in small cages.\n\nIn 1997, when Carole’s second husband and multi-millionaire, Don Lewis, was getting ready to file for divorce while also taking other legal precautions to keep himself safe from Carole. One night, Don magically vanishes off the face of the Earth. So, we’re going to piece together all the evidence, along with breaking down her body language, to find out if Carole could be involved in his disappearance.\n\nNow, in the comments, what do you think happened to Don Lewis? Was it the tigers, septic tank, did she hide him during that suspicious 3AM drive, or maybe you somehow believe that he crashed his little airplane in the ocean.  Let everyone know in the comments below.\n\nGive this video a thumbs up if you think Carole Baskin was somehow involved in Don Lewis’s disappearance.\nGive this video a thumbs down if you think Carole Baskin wasn’t involved at all.\n\nHit that subscribe button now, so you don’t miss out on new body language and investigative videos that always shake up YouTube, and I’ll see you at the top.\n\n#TigerKing #CaroleBaskin #BodyLanguage\n\nMore Channel:\r\nhttps://www.youtube.com/channel/UCGof-YmYH1e-Hu9tmH39_rw\r\n\r\nSHAKED Podcast:\r\nhttps://www.youtube.com/shaked\r\n\r\nFollow me and also send me your future vide
